// Function to update chess.com stats
function updateChessStats() {
    fetch('https://api.chess.com/pub/player/failedprodigy')
      .then(response => response.json())
      .then(data => {
        const currentTime = Math.floor(Date.now() / 1000); // Current time in seconds
        const lastOnline = data.last_online || 0; // Last online time in seconds
        const isOnline = currentTime - lastOnline < 300; // Considered online if last online within 5 minutes (300 seconds)
  
        const playingStatus = isOnline ? `Playing chess vs ${data.opponent || '...'}` : 'Not playing at the moment';
        document.getElementById('playing-status').textContent = playingStatus;
        const dotColor = isOnline ? 'green' : 'gray';
        document.getElementById('status-dot').style.backgroundColor = dotColor;
      });
  
    fetch('https://api.chess.com/pub/player/FailedProdigy/stats')
      .then(response => response.json())
      .then(data => {
        const blitzRating = data.chess_blitz ? data.chess_blitz.last.rating : 'N/A';
        const rapidRating = data.chess_rapid ? data.chess_rapid.last.rating : 'N/A';
        const bulletRating = data.chess_bullet ? data.chess_bullet.last.rating : 'N/A';
        const globalRank = data.chess_blitz ? data.chess_blitz.rank : 'N/A';
        const percentile = data.chess_blitz ? data.chess_blitz.percentile : 'N/A';
  
        document.getElementById('blitz-rating-value').textContent = blitzRating;
        document.getElementById('rapid-rating-value').textContent = rapidRating;
        document.getElementById('bullet-rating-value').textContent = bulletRating;
        document.getElementById('global-rank-value').textContent = globalRank !== undefined && percentile !== undefined ? '#' + globalRank + ' (' + percentile + ')' : 'N/A';
      });
  }
  
  // Initial call to update stats
  updateChessStats();
  
  // Schedule updates every 0.5 seconds
  setInterval(updateChessStats, 500); // Changed to 500 milliseconds (0.5 seconds)
  


function updateTime() {
    var now = new Date();
    var hours = now.getHours();
    var minutes = now.getMinutes();
    var seconds = now.getSeconds();

    var timeString = padZero(hours) + ":" + padZero(minutes) + ":" + padZero(seconds) + " in Harare";
    document.getElementById('clock').innerText = timeString;
}

function padZero(num) {
    return (num < 10 ? '0' : '') + num;
}

updateTime(); // Call updateTime once to display the time immediately
setInterval(updateTime, 1000); // Update time every second

