$(document).ready(function() {
    var lastfmData = {
        baseURL: "https://ws.audioscrobbler.com/2.0/?method=user.getrecenttracks&user=",
        user: "osirumiji",
        api_key: "5f457b5835589e7cbba47bc99d9d6139",
        additional: "&format=json&limit=1"
    };

    var getSetLastFM = function() {
        $.ajax({
            type: "GET",
            url: lastfmData.baseURL + lastfmData.user + "&api_key=" + lastfmData.api_key + lastfmData.additional,
            dataType: "json",
            success: function(resp) {
                // The most recently played track is the first element in the recenttracks.track array
                var recentTracks = resp.recenttracks.track;
                if (recentTracks.length > 0) {
                    var recentTrack = recentTracks[0];
                    var nowPlayingTrack = recentTrack['@attr'] && recentTrack['@attr'].nowplaying === 'true';

                    // Check if the track is currently playing on Spotify
                    if (nowPlayingTrack) {
                        $(".status-text .year").text("Currently playing on Spotify");
                    } else {
                        $(".status-text .year").text("Last played on Spotify");
                    }

                    // Update track information
                    var formatted = `<img src="img/spotify/track.png">${recentTrack.name}`;
                    $("a#tracktitle")
                        .html(formatted)
                        .attr("href", recentTrack.url)
                        .attr("title", `${recentTrack.name} by ${recentTrack.artist["#text"]}`)
                        .attr("target", "_blank");

                    var artistFormatted = `<img src="img/spotify/artist.png">${recentTrack.artist["#text"]}`;
                    $("#trackartist")
                        .html(artistFormatted)
                        .attr("title", `Artist: ${recentTrack.artist["#text"]}`);
                    $("img#trackart").attr("src", recentTrack.image[2]["#text"]);
                } else {
                    // Handle the case when there are no recent tracks
                    $(".status-text .year").text("No recent tracks found");
                }
            },
            error: function() {
                // Handle error
                $(".status-text .year").text("Unable to retrieve playback status");
            }
        });
    };

    // Get the new one.
    getSetLastFM();
    // Start the countdown.
    setInterval(getSetLastFM, 10 * 10);
});

function handlePageLoader() {	
		
    if ($('#page-loader').length > 0) {
        
        var hash = window.location.hash;
        
        $(".loader-img").delay(500).fadeOut();
        $("#page-loader").delay(1000).fadeOut("slow");
        
        if(!hash) { 
            // Do nothing //
        } else {
            $(document).scrollTop( $(hash).offset().top -56); 
        }
        
    }
}

